import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

function NewsComp() {
    return (
        <div>
            <Container>
                <Row>
                    <Col>
                    Church News:
                    Donations, time change, 
                    food drive, serving opportunities
                    </Col>
                </Row>
            </Container>
        </div>
    )
};

export default NewsComp;
